import Mock from 'mockjs'
import user from './user';

Mock.mock('/room/user',user.room);
Mock.mock('/room/admin/',{
    id: 1,
    roomId: 1,
    userId: 1,
    start: '1-1-2000',
    end: '1-1-2000'
});
Mock.mock('/reservation/user',{
    id: 1,
    roomId: 1,
    start: '1-1-2000',
    end: '1-1-2000'
});
Mock.mock('/reservation/admin',{
    id:1,
    roomId:1,
    userId:1,
    start:'1-1-2000',
    end:'1-1-2000'
});
